import React from 'react';
import './cta.css';

const CTA = () => {
  return (
    <div className='gpt3__cta'>
      <div className='gpt3__cta-text'>
        <p></p>
        <h3>Did you know one of my hobbies is playing video games? Check out my stats and content.</h3>
      </div>
      <div className='gpt3__cta-btn'>
        <button className = "heartbeat"type="button">Game Stats</button>
      </div>
    </div>
  )
}

export default CTA
